import React from 'react';
import Head from 'next/head';
import AppLayout from '../components/AppLayout';

const Signup = () => {
    return (
        <>
            <Head>
                <title>Sign up | Nodebird</title>
            </Head>
            <AppLayout>Sign up Page</AppLayout>
        </>
    )
};

export default Signup;
